import "./App.css";

function App() {
  const style = {
    width: "20px",
    border: "2px solid green",
  };
  return (
    <div className="App">
      <div style={style}>감자</div>
      <div>고구마</div>
      <div>오이</div>
      <div>가지</div>
      <div>옥수수</div>
    </div>
  );
}

export default App;
